import React from "react";
import { NavLink } from "react-router-dom";
const Menu = () => {
  return (
    <>
      <NavLink
        to="/"
        className={({ isActive }) =>
          isActive ? activeClassName : active_class
        }
      >
        about
      </NavLink>
      <NavLink
        to="/contact"
        className={({ isActive }) =>
          isActive ? activeClassName : "active_class"
        }
      >
        contact
      </NavLink>
      <br />
      <a href="/">about</a>;<a href="/contact">contact</a>;
    </>
  );
};
export default Menu;
